import * as ReactDOM from "react-dom";
import InfoBox from "./InfoBox";

const StudentList = (props) => {
  const handleShow = (id) => {
    const path = "/student-info/".concat(id);
    console.log(path);
    //history.back()
    ReactDOM.render(<InfoBox id={id} />, document.getElementById("root"));
  };

  return (
    <table>
      <thead>
        <tr>
          <th> Name</th>
          <th> Surname</th>
          <th> ID Number</th>
          <th>Risk Status</th>
        </tr>
      </thead>
      <tbody>
        {props.data &&
          props.data.map((student) => {
            return (
              <>
                <a href="#" className="list-group-item list-group-item-action">
                  <div className="d-flex w-100 justify-content-between">
                    <h5 className="mb-1">{notifications.header}</h5>
                    <small>{notifications.date} days ago</small>
                  </div>
                  <p className="mb-1">{notifications.content}</p>
                </a>
              </>
            );
          })}
      </tbody>
    </table>
  );
};
export default StudentList;
